function ExchangeC() {
    const accounts = [
        { label: 'Dolar'},
        { label: 'Tl'},
        { label: 'Altın'},
        { label: 'Euro'},
    ];
    return (
        <div className="container">
            <Autocomplete
      disablePortal
      id="combo-box-demo"
      options={top100Films}
      sx={{ width: 300 }}
      renderInput={(params) => <TextField {...params} label="Movie" />}
    />
        </div>
    );
}
export default ExchangeC;
